import React from "react";

import Button from "../UI/Button.js";

const UserInput = () => {
  return (
    <div className="user-input">
      <form>
        <div>
          <label>Username</label>
          <input type="text" />
        </div>
        <div>
          <label>Age(Years)</label>
          <input type="number" />
        </div>
        <Button>Add User</Button>
      </form>
    </div>
  );
};

export default UserInput;
